    def start(self, game:str):
        '''
        Starts an OpenAI gym environment.
        Caller:
            - Trial.start()
        Inputs:
            -   game (Type: str corresponding to allowable gym environments)
        Returs:
            - env (Type: OpenAI gym Environment as returned by gym.make())
            Mandatory
        '''
        self.env = gym.make(game)
        
        print('inside agent start')
        print('game', game)
        print('self.env', self.env)
        return
    def save_transition(self, next_obs, action, reward, done):
        self.transition['obs'].append(np.array(self.current_obs, dtype= np.float32))
        self.transition['next_obs'].append(np.array(next_obs, dtype= np.float32))
        self.transition['reward'].append(reward)
        self.transition['action'].append(action)
        self.transition['dones'].append(done)
        
    def step(self, action:int):
        '''
        Takes a game step.
        Caller: 
            - Trial.take_step()
        Inputs:
            - env (Type: OpenAI gym Environment)
            - action (Type: int corresponding to action in env.action_space)
        Returns:
            - envState (Type: dict containing all information to be recorded for future use)
              change contents of dict as desired, but return must be type dict.
        '''
        #next_observation, reward, terminated, truncated, info = self.env.step(action)

        next_observation, reward, done, info = self.env.step(action)

        self.save_transition(next_observation, action, reward, done)
        self.current_obs = next_observation
        return done
    
    def render(self):
        '''
        Gets render from gym.
        Caller:
            - Trial.get_render()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns:
            - return from env.render('rgb_array') (Type: npArray)
              must return the unchanged rgb_array
        '''
        return self.env.render('rgb_array')
    

       

    def reset(self):
        '''
        Resets the environment to start new episode.
        Caller: 
            - Trial.reset()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns: 
            No Return
        '''
        
        self.episode+=1
        print('agent reset')
        print(f'episode = {self.episode}')
        self.env.seed(0)
        self.current_obs  = self.env.reset()

        print('inital_state', self.current_obs)


    
    def close(self):
        '''
        Closes the environment at the end of the trial.
        Caller:
            - Trial.close()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns:
            No Return
        '''

        self.env.close()